   105→  // Load historical data progressively, going back in time
   106→  private async loadHistoricalDataProgressively(symbol: string): Promise<void> {
   107→    const metadata = await this.cache.getMetadata(symbol);
   108→    const now = Math.floor(Date.now() / 1000);
   109→    
   110→    for (const [granularity, config] of Object.entries(this.loadStrategy)) {
   111→      // Check how far back we have data
   112→      const granularityData = metadata?.granularityRanges[granularity];
   113→      const earliestData = granularityData?.startTime || now;
   114→      const daysCovered = (now - earliestData) / 86400;
   115→      
   116→      // If we haven't reached max days, load more
   117→      if (daysCovered < config.maxDays) {
   118→        const tasks: LoadTask[] = [];
   119→        
   120→        // Calculate chunks to load
   121→        let currentEnd = earliestData;
   122→        const targetStart = now - (config.maxDays * 86400);
   123→        
   124→        while (currentEnd > targetStart) {
   125→          const chunkStart = Math.max(currentEnd - (config.chunkDays * 86400), targetStart);
   126→          
   127→          tasks.push({
   128→            symbol,
   129→            granularity,
   130→            startTime: chunkStart,
   131→            endTime: currentEnd,
   132→            priority: this.getGranularityPriority(granularity) + (now - currentEnd) / 86400
   133→          });
   134→          
   135→          currentEnd = chunkStart;
   136→        }
   137→        
   138→        // Execute loads with concurrency limit
   139→        console.log(`Loading ${tasks.length} chunks for ${granularity}`);
   140→        await Promise.all(
   141→          tasks.map(task => this.limit(() => this.loadChunk(task)))
   142→        );
   143→      }
   144→    }
   145→  }
