   153→      return;
   154→    }
   155→    
   156→    this.currentTasks.add(taskKey);
   157→    
   158→    try {
   159→      // Check if we already have this data
   160→      const cached = await this.cache.getCachedCandles(
   161→        task.symbol,
   162→        task.granularity,
   163→        task.startTime,
   164→        task.endTime
   165→      );
   166→      
   167→      // Only fetch if we have gaps
   168→      if (cached.gaps.length > 0) {
   169→        console.log(`Loading ${task.granularity} data from ${new Date(task.startTime * 1000).toISOString()} to ${new Date(task.endTime * 1000).toISOString()}`);
