   171→        // Fetch data for each gap
   172→        for (const gap of cached.gaps) {
   173→          await this.fetchAndStoreGap(task.symbol, task.granularity, gap);
   174→        }
   175→      }
   176→    } catch (error) {
   177→      console.error(`Error loading chunk ${taskKey}:`, error);
   178→    } finally {
   179→      this.currentTasks.delete(taskKey);
   180→    }
   181→  }
